      <Login/>
      </div>
      <h4>Don't have an account? <Link to='/signup' className='sinback'>Signup</Link></h4>
      {/* <img id="home-wall" src={'https://blog.trustico.com/wp-content/uploads/2016/08/hotel2.jpg'} alt="Home"/> */}

      
    </div>
  )
}
